//{{{  nodeStruct

function nodeStruct (ply, state) {
  this.ply         = ply+1;
  this.state       = state;
  this.parent      = 0;
  this.child       = 0;
  this.quietMoves  = Array(MAX_MOVES);
  this.noiseyMoves = Array(MAX_MOVES);
  this.quietRanks  = Array(MAX_MOVES);
  this.noiseyRanks = Array(MAX_MOVES);
  this.quietNum    = 0;
  this.noiseyNum   = 0;
  this.nextMove    = 0;
  this.inCheck     = 0;
  this.turn        = 0;
  this.moved       = 0;
  this.nextMove    = 0;
  this.stage       = 0;
  this.cacheTurn   = 0;
  this.cacheRights = 0;
  this.cacheEp     = 0;
  this.maxR        = 0;  // hack
}

//}}}

const nodes = Array(MAX_PLY);

//{{{  initOnceNodes

function initOnceNodes() {

  for (let i=0; i < nodes.length; i++)
    nodes[i] = new nodeStruct(i, state);

  for (let i=0; i < nodes.length-1; i++)
    nodes[i].child = nodes[i+1];

  for (let i=1; i < nodes.length; i++)
    nodes[i].parent = nodes[i-1];
}

