//{{{  unmakeMove

function unmakeMove (move) {

  const s = state;
  const b = s.board;

  const fr    = moveFromSq(move);
  const to    = moveToSq(move);
  const toObj = moveToObj(move);
  const frObj = moveFromObj(move);

  b[fr] = frObj;
  b[to] = toObj;

  if (move & MOVE_IKKY_MASK)
    unmakeIkkyMove(move);
}

